// MOCK API: Fetches existing events
export const getEvents = async (): Promise<CityEvent[]> => {
  console.log('Fetching existing events...');
  await sleep(1000); // Simulate API call latency
  console.log('Fetched events:', initialEvents);
  return Promise.resolve(initialEvents.sort((a, b) => b.timestamp.getTime() - a.timestamp.getTime()));
};

// MOCK API: Submits a new report and gets an AI-synthesized event back
export const submitReport = async (report: NewReport): Promise<{ newEvent: CityEvent, pointsAwarded: number }> => {
  console.log('Submitting report to mock Gemini service...', report);
  await sleep(2500); // Simulate AI processing time

  // Mock Gemini's multimodal analysis and summarization
  const summary = `Synthesized Report: ${report.category.replace('_', ' ')} near provided coordinates`;
  const description = `Based on user submission, we've identified a new event. The report indicates: "${report.description}". This has been categorized as a ${report.category.toLowerCase().replace('_', ' ')} and logged for further action.`;

  const newEvent: CityEvent = {
    id: `evt_${Date.now()}`,
    category: report.category,
    summary,
    description,
    location: {
      ...report.location,
      address: `Near (${report.location.lat.toFixed(4)}, ${report.location.lng.toFixed(4)})`
    },
    timestamp: new Date(),
    sentiment: report.category === EventCategory.Emergency ? Sentiment.Critical : Sentiment.Negative,
    status: Status.Reported,
    imageUrl: report.imageFile ? URL.createObjectURL(report.imageFile) : `https://picsum.photos/seed/${Date.now()}/400/300`,
    resolutionTimeline: 'Awaiting confirmation from authorities.',
    source: 'Citizen Report'
  };
  
  console.log('Mock Gemini service returned new event:', newEvent);
  initialEvents.unshift(newEvent); // Add to our mock DB
  return Promise.resolve({ newEvent, pointsAwarded: 10 });
};

// MOCK API: Generates a concise summary for a notification
export const getNotificationSummary = async (event: CityEvent): Promise<string> => {
  console.log('Generating notification summary for event:', event.id);
  await sleep(200); // Simulate tiny AI processing time
  return `A new event has been reported: "${event.summary}" near ${event.location.address}. Authorities are being notified.`;
};


// MOCK API: Simulates a chat response from the AI assistant
export const getChatResponse = async (message: string, events: CityEvent[]): Promise<StructuredChatResponse> => {
    console.log(`Getting AI response for: "${message}"`);
    await sleep(1500); // Simulate AI thinking time

    const lowerCaseMessage = message.toLowerCase();

    const trafficEvent = events.find(e => e.category === EventCategory.Traffic && lowerCaseMessage.includes(e.location.address?.toLowerCase() || 'impossible'));

    if (trafficEvent && (lowerCaseMessage.includes('avoid') || lowerCaseMessage.includes('route'))) {
         // Mock a route that goes around the traffic event
        const route: Location[] = [
            { lat: trafficEvent.location.lat + 0.01, lng: trafficEvent.location.lng - 0.01 },
            { lat: trafficEvent.location.lat + 0.015, lng: trafficEvent.location.lng },
            { lat: trafficEvent.location.lat + 0.01, lng: trafficEvent.location.lng + 0.01 },
        ];
        return {
            text: `Yes, there's heavy traffic at ${trafficEvent.location.address}. I've highlighted a possible alternative route on the map for you. Please drive carefully.`,
            action: { type: 'HIGHLIGHT_ROUTE', payload: route }
        };
    }


    if (lowerCaseMessage.includes('traffic') || lowerCaseMessage.includes('route') || lowerCaseMessage.includes('road')) {
        const trafficEvents = events.filter(e => e.category === EventCategory.Traffic);
        if (trafficEvents.length > 0) {
            const eventSummaries = trafficEvents.map(e => `there's ${e.summary.toLowerCase()}`).join('; and ');
            return { text: `Based on current reports, ${eventSummaries}. I'd advise avoiding these areas if possible. You can ask me for a route around a specific location.` };
        } else {
            return { text: "The roads seem to be clear of major incidents right now. Travel safely!" };
        }
    }

    if (lowerCaseMessage.includes('safe') || lowerCaseMessage.includes('emergency')) {
        const criticalEvents = events.filter(e => e.sentiment === Sentiment.Critical);
        if (criticalEvents.length > 0) {
            const eventSummaries = criticalEvents.map(e => e.summary.toLowerCase()).join('; and ');
            return { text: `There are a few critical alerts active: ${eventSummaries}. Please be extra cautious, especially in these areas.` };
        } else {
            return { text: "Things seem relatively calm, with no critical emergencies reported. As always, stay aware of your surroundings." };
        }
    }

    if (lowerCaseMessage.includes('what') && lowerCaseMessage.includes('happening')) {
      const latestEvent = events[0];
      return { text: `The latest report is about ${latestEvent.summary.toLowerCase()} at ${latestEvent.location.address}. You can select it from the feed for more details. Is there anything else I can help with?` };
    }

    return { text: "I am City Pulse AI, your guide to the city's real-time events. You can ask me about traffic, routes, or safety. How can I assist you?" };
};

